        "name": "skywrath_crown_blink_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_blink_02.mp3",
        "text": "To greater heights."
    },
    {
        "name": "skywrath_crown_bottle_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_bottle_01.mp3",
        "text": "We'll find a better use."
    },
    {
        "name": "skywrath_crown_bottle_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_bottle_02.mp3",
        "text": "What's good for the bottle is good for me."
    },
    {
        "name": "skywrath_crown_bottle_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_bottle_03.mp3",
        "text": "I was hoping it would be here."
    },
    {
        "name": "skywrath_crown_bottle_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_bottle_04.mp3",
        "text": "And now, I wait."
    },
    {
        "name": "skywrath_crown_bottle_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_bottle_05.mp3",
        "text": "Time creeps onward."
    },
    {
        "name": "skywrath_crown_bottle_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_bottle_06.mp3",
        "text": "Sometimes, there is no need for action."
    },
    {
        "name": "skywrath_crown_bounty_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_bounty_01.mp3",
        "text": "A tithe in Scree'auk's name."
    },
    {
        "name": "skywrath_crown_bounty_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_bounty_02.mp3",
        "text": "Ah, much-needed coin."
    },
    {
        "name": "skywrath_crown_bounty_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_bounty_03.mp3",
        "text": "Alms for my quest."
    },
    {
        "name": "skywrath_crown_bounty_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_bounty_04.mp3",
        "text": "Bounty!"
    },
    {
        "name": "skywrath_crown_bounty_04_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_bounty_04_02.mp3",
        "text": "Bounty!"
    },
    {
        "name": "skywrath_crown_cast_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_01.mp3",
        "text": "Prepare for a reckoning!"
    },
    {
        "name": "skywrath_crown_cast_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_02.mp3",
        "text": "The skies are dark with Skywrath power!"
    },
    {
        "name": "skywrath_crown_cast_02_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_02_02.mp3",
        "text": "The skies are dark with Skywrath power!"
    },
    {
        "name": "skywrath_crown_cast_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_03.mp3",
        "text": "Fly where you will, I will follow you there!"
    },
    {
        "name": "skywrath_crown_cast_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_04.mp3",
        "text": "Might of the arcane, come to me."
    },
    {
        "name": "skywrath_crown_cast_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_05.mp3",
        "text": "There is no escaping my power."
    },
    {
        "name": "skywrath_crown_cast_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_06.mp3",
        "text": "My magic engulfs you!"
    },
    {
        "name": "skywrath_crown_cast_pain_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_pain_01.mp3",
        "text": "I have enough in me for another spell..."
    },
    {
        "name": "skywrath_crown_cast_pain_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_pain_02.mp3",
        "text": "My body is broken, but my mind remains sharp."
    },
    {
        "name": "skywrath_crown_cast_pain_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_pain_03.mp3",
        "text": "Still some juice in me."
    },
    {
        "name": "skywrath_crown_cast_pain_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_pain_04.mp3",
        "text": "My blood may flow, but so does my mana."
    },
    {
        "name": "skywrath_crown_cast_pain_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_pain_05.mp3",
        "text": "Scree'auk, let me channel this pain into power."
    },
    {
        "name": "skywrath_crown_cast_pain_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_pain_06.mp3",
        "text": "Even wounded, I summon potent forces."
    },
    {
        "name": "skywrath_crown_cast_pain_07",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_pain_07.mp3",
        "text": "My pain only fuels my spells' fire."
    },
    {
        "name": "skywrath_crown_cast_pain_08",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_pain_08.mp3",
        "text": "I'll cast spells even with my last words."
    },
    {
        "name": "skywrath_crown_cast_pain_09",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_pain_09.mp3",
        "text": "My body may be weakened, yet I still have other strength."
    },
    {
        "name": "skywrath_crown_cast_pain_10",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_cast_pain_10.mp3",
        "text": "If I have to shriek my spells, I will."
    },
    {
        "name": "skywrath_crown_concussive_shot_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_01.mp3",
        "text": "A burden to slow you."
    },
    {
        "name": "skywrath_crown_concussive_shot_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_02.mp3",
        "text": "Some lead for your boots."
    },
    {
        "name": "skywrath_crown_concussive_shot_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_03.mp3",
        "text": "That's close enough for now."
    },
    {
        "name": "skywrath_crown_concussive_shot_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_04.mp3",
        "text": "I'll thank you to stay put."
    },
    {
        "name": "skywrath_crown_concussive_shot_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_05.mp3",
        "text": "Here's a lession in caution."
    },
    {
        "name": "skywrath_crown_concussive_shot_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_06.mp3",
        "text": "Take your time."
    },
    {
        "name": "skywrath_crown_concussive_shot_07",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_07.mp3",
        "text": "You're too close!"
    },
    {
        "name": "skywrath_crown_concussive_shot_08",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_08.mp3",
        "text": "Bal'lash!"
    },
    {
        "name": "skywrath_crown_concussive_shot_08_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_08_02.mp3",
        "text": "Bal'lash!"
    },
    {
        "name": "skywrath_crown_concussive_shot_09",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_09.mp3",
        "text": "Kro'kara!"
    },
    {
        "name": "skywrath_crown_concussive_shot_09_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_09_02.mp3",
        "text": "Kro'kara!"
    },
    {
        "name": "skywrath_crown_concussive_shot_10",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_10.mp3",
        "text": "Ayakh!"
    },
    {
        "name": "skywrath_crown_concussive_shot_10_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_concussive_shot_10_02.mp3",
        "text": "Ayakh!"
    },
    {
        "name": "skywrath_crown_crumwiz_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_crumwiz_01.mp3",
        "text": "What a crummy wizard."
    },
    {
        "name": "skywrath_crown_death_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_01.mp3",
        "text": "Gladly...I give my life...for the cause."
    },
    {
        "name": "skywrath_crown_death_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_02.mp3",
        "text": "I've already...won."
    },
    {
        "name": "skywrath_crown_death_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_03.mp3",
        "text": "I take...nothing back."
    },
    {
        "name": "skywrath_crown_death_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_04.mp3",
        "text": "I'll find her...in...another life."
    },
    {
        "name": "skywrath_crown_death_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_05.mp3",
        "text": "I thought I'd die...long ago."
    },
    {
        "name": "skywrath_crown_death_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_06.mp3",
        "text": "Agh!"
    },
    {
        "name": "skywrath_crown_death_07",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_07.mp3",
        "text": "I fall!"
    },
    {
        "name": "skywrath_crown_death_08",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_08.mp3",
        "text": "I vanish from this realm."
    },
    {
        "name": "skywrath_crown_death_09",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_09.mp3",
        "text": "The Eyrie beckons."
    },
    {
        "name": "skywrath_crown_death_10",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_10.mp3",
        "text": "I return to her embrace."
    },
    {
        "name": "skywrath_crown_death_11",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_11.mp3",
        "text": "I die so that she may live."
    },
    {
        "name": "skywrath_crown_death_12",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_12.mp3",
        "text": "What a bitter end!"
    },
    {
        "name": "skywrath_crown_death_13",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_13.mp3",
        "text": "My wings clipped, I soar no more."
    },
    {
        "name": "skywrath_crown_death_14",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_14.mp3",
        "text": "My life for hers, 'tis a glorious exchange."
    },
    {
        "name": "skywrath_crown_death_15",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_15.mp3",
        "text": "Curses! Grounded!"
    },
    {
        "name": "skywrath_crown_death_16",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_16.mp3",
        "text": "The end is nigh. Oh, wait. It's here."
    },
    {
        "name": "skywrath_crown_death_17",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_17.mp3",
        "text": "Plucked from this mortal coil."
    },
    {
        "name": "skywrath_crown_death_18",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_18.mp3",
        "text": "My duty, unfulfilled."
    },
    {
        "name": "skywrath_crown_death_19",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_19.mp3",
        "text": "My pain is outweighed by my shame."
    },
    {
        "name": "skywrath_crown_death_20",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_20.mp3",
        "text": "Never to fly again."
    },
    {
        "name": "skywrath_crown_death_21",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_death_21.mp3",
        "text": "To fall from such a height..."
    },
    {
        "name": "skywrath_crown_debut_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_debut_01.mp3",
        "text": "Where you fly, I follow..."
    },
    {
        "name": "skywrath_crown_debut_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_debut_02.mp3",
        "text": "...Long live the true queen!"
    },
    {
        "name": "skywrath_crown_debut_02_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_debut_02_02.mp3",
        "text": "...and the true queen!"
    },
    {
        "name": "skywrath_crown_debut_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_debut_03.mp3",
        "text": "By the powers of Scree'auk..."
    },
    {
        "name": "skywrath_crown_deny_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_01.mp3",
        "text": "Denied."
    },
    {
        "name": "skywrath_crown_deny_01_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_01_02.mp3",
        "text": "Denied."
    },
    {
        "name": "skywrath_crown_deny_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_02.mp3",
        "text": "Denied!"
    },
    {
        "name": "skywrath_crown_deny_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_03.mp3",
        "text": "I won't let you."
    },
    {
        "name": "skywrath_crown_deny_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_04.mp3",
        "text": "All you can do is seethe."
    },
    {
        "name": "skywrath_crown_deny_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_05.mp3",
        "text": "Did that look close?"
    },
    {
        "name": "skywrath_crown_deny_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_06.mp3",
        "text": "A cleaner death."
    },
    {
        "name": "skywrath_crown_deny_07",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_07.mp3",
        "text": "Not a chance."
    },
    {
        "name": "skywrath_crown_deny_08",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_08.mp3",
        "text": "Not on my watch."
    },
    {
        "name": "skywrath_crown_deny_09",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_09.mp3",
        "text": "Enough of you."
    },
    {
        "name": "skywrath_crown_deny_10",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_10.mp3",
        "text": "Begone!"
    },
    {
        "name": "skywrath_crown_deny_11",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_11.mp3",
        "text": "That is mine."
    },
    {
        "name": "skywrath_crown_deny_12",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_12.mp3",
        "text": "No great loss."
    },
    {
        "name": "skywrath_crown_deny_13",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_13.mp3",
        "text": "Tis nothing."
    },
    {
        "name": "skywrath_crown_deny_14",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_14.mp3",
        "text": "Away with you!"
    },
    {
        "name": "skywrath_crown_deny_15",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_15.mp3",
        "text": "Ha ha ha ha ha ha ha ha ha ha ha!"
    },
    {
        "name": "skywrath_crown_deny_16",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_16.mp3",
        "text": "Ha!"
    },
    {
        "name": "skywrath_crown_deny_17",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_17.mp3",
        "text": "Foiled!"
    },
    {
        "name": "skywrath_crown_deny_18",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_18.mp3",
        "text": "You are denied."
    },
    {
        "name": "skywrath_crown_deny_19",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_19.mp3",
        "text": "I think not."
    },
    {
        "name": "skywrath_crown_deny_20",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_20.mp3",
        "text": "Ha ha ha!"
    },
    {
        "name": "skywrath_crown_deny_21",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_21.mp3",
        "text": "Down you go!"
    },
    {
        "name": "skywrath_crown_deny_22",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_22.mp3",
        "text": "A small loss."
    },
    {
        "name": "skywrath_crown_deny_23",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_23.mp3",
        "text": "A trifle!"
    },
    {
        "name": "skywrath_crown_deny_24",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_24.mp3",
        "text": "Ha ha!"
    },
    {
        "name": "skywrath_crown_deny_pain_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_pain_01.mp3",
        "text": "Not while I have life in me!"
    },
    {
        "name": "skywrath_crown_deny_pain_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_pain_02.mp3",
        "text": "I still have strength to hold you back!"
    },
    {
        "name": "skywrath_crown_deny_pain_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_pain_03.mp3",
        "text": "Not so long as I stand."
    },
    {
        "name": "skywrath_crown_deny_pain_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_pain_04.mp3",
        "text": "Not on this plane or any other!"
    },
    {
        "name": "skywrath_crown_deny_pain_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_pain_05.mp3",
        "text": "You'll have to kill me to get away with that."
    },
    {
        "name": "skywrath_crown_deny_pain_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_pain_06.mp3",
        "text": "I won't yield so easily."
    },
    {
        "name": "skywrath_crown_deny_pain_07",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_pain_07.mp3",
        "text": "I may bleed, but I'll never bow."
    },
    {
        "name": "skywrath_crown_deny_pain_08",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_pain_08.mp3",
        "text": "Even with my last breath, I won't submit."
    },
    {
        "name": "skywrath_crown_deny_pain_09",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_pain_09.mp3",
        "text": "My body may break. My will won't."
    },
    {
        "name": "skywrath_crown_deny_pain_10",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_deny_pain_10.mp3",
        "text": "I may be battered, but not beaten."
    },
    {
        "name": "skywrath_crown_doubdam_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_doubdam_01.mp3",
        "text": "Double damage!"
    },
    {
        "name": "skywrath_crown_doubdam_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_doubdam_02.mp3",
        "text": "I shall spill twice as much blood."
    },
    {
        "name": "skywrath_crown_doubdam_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_doubdam_03.mp3",
        "text": "Scree'auk's strength flows through me."
    },
    {
        "name": "skywrath_crown_facelessvoid_rival_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_facelessvoid_rival_01.mp3",
        "text": "Don't ever show your face around here again."
    },
