    },
    {
        "name": "skywrath_crown_levelup_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_01.mp3",
        "text": "I fly to new heights!"
    },
    {
        "name": "skywrath_crown_levelup_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_02.mp3",
        "text": "I have ascended!"
    },
    {
        "name": "skywrath_crown_levelup_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_03.mp3",
        "text": "New power flows to my wingtips."
    },
    {
        "name": "skywrath_crown_levelup_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_04.mp3",
        "text": "Ever I rise."
    },
    {
        "name": "skywrath_crown_levelup_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_05.mp3",
        "text": "I climb yet higher."
    },
    {
        "name": "skywrath_crown_levelup_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_06.mp3",
        "text": "My power grows greater, my wings wider,"
    },
    {
        "name": "skywrath_crown_levelup_07",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_07.mp3",
        "text": "The higher I go, the smaller all seems."
    },
    {
        "name": "skywrath_crown_levelup_08",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_08.mp3",
        "text": "I feel even greater."
    },
    {
        "name": "skywrath_crown_levelup_09",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_09.mp3",
        "text": "My prowess grows. So too my victories."
    },
    {
        "name": "skywrath_crown_levelup_10",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_10.mp3",
        "text": "There's no end to how high I can fly."
    },
    {
        "name": "skywrath_crown_levelup_11",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_11.mp3",
        "text": "By the mists of the arcane, I grow stronger!"
    },
    {
        "name": "skywrath_crown_levelup_12",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_12.mp3",
        "text": "All the better to defeat my foes."
    },
    {
        "name": "skywrath_crown_levelup_13",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_13.mp3",
        "text": "My powers soar!"
    },
    {
        "name": "skywrath_crown_levelup_14",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_14.mp3",
        "text": "The greatest of all Skywrath!"
    },
    {
        "name": "skywrath_crown_levelup_15",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_15.mp3",
        "text": "Scree'auk, help guide the course of my wings."
    },
    {
        "name": "skywrath_crown_levelup_16",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_16.mp3",
        "text": "Power presents choice."
    },
    {
        "name": "skywrath_crown_levelup_17",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_17.mp3",
        "text": "Excellent, yes. But we need more."
    },
    {
        "name": "skywrath_crown_levelup_18",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_18.mp3",
        "text": "The truth of my heart shall be writ upon the skies."
    },
    {
        "name": "skywrath_crown_levelup_19",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_levelup_19.mp3",
        "text": "Ah, Scree'auk, your blood enthralls me!"
    },
    {
        "name": "skywrath_crown_lion_rival_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_lion_rival_01.mp3",
        "text": "Poor stolen demon hand - attached to a weak coward."
    },
    {
        "name": "skywrath_crown_lion_rival_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_lion_rival_02.mp3",
        "text": "I'd be lion if I said you fought well, dead man."
    },
    {
        "name": "skywrath_crown_lion_rival_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_lion_rival_03.mp3",
        "text": "Go to hell and stay there."
    },
    {
        "name": "skywrath_crown_lose_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_lose_01.mp3",
        "text": "How could it all be for nothing?"
    },
    {
        "name": "skywrath_crown_lose_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_lose_02.mp3",
        "text": "I thought we finally had a chance..."
    },
    {
        "name": "skywrath_crown_lose_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_lose_03.mp3",
        "text": "I fall in shame!"
    },
    {
        "name": "skywrath_crown_lotuspool_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_lotuspool_01.mp3",
        "text": "Before my foes can make use of this."
    },
    {
        "name": "skywrath_crown_lotuspool_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_lotuspool_02.mp3",
        "text": "I take this for Scree'auk."
    },
    {
        "name": "skywrath_crown_lotuspool_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_lotuspool_03.mp3",
        "text": "Let my power blossom."
    },
    {
        "name": "skywrath_crown_lotuspool_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_lotuspool_04.mp3",
        "text": "I take this for Scree'auk. And me."
    },
    {
        "name": "skywrath_crown_meepo_ally_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_meepo_ally_01.mp3",
        "text": "You should avoid Skywrath. There may still be a price on your head."
    },
    {
        "name": "skywrath_crown_meepo_ally_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_meepo_ally_02.mp3",
        "text": "It's one scrape to the next for you."
    },
    {
        "name": "skywrath_crown_meepo_ally_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_meepo_ally_03.mp3",
        "text": "Still gambling with dangerous people? That kind of life will be your end."
    },
    {
        "name": "skywrath_crown_meepo_ally_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_meepo_ally_04.mp3",
        "text": "We meet again, Meepos. And we WILL have words after the battle."
    },
    {
        "name": "skywrath_crown_meepo_ally_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_meepo_ally_05.mp3",
        "text": "We did not part on good terms, Meepos. But for today, I call a truce."
    },
    {
        "name": "skywrath_crown_meepo_rival_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_meepo_rival_01.mp3",
        "text": "Justice is not always swift, but it will find you. Or I will."
    },
    {
        "name": "skywrath_crown_meepo_rival_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_meepo_rival_02.mp3",
        "text": "TEN of you would be nothing to one skywrath mage."
    },
    {
        "name": "skywrath_crown_monologue_a_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_a_01.mp3",
        "text": "Guilt, paranoia, pity...contempt."
    },
    {
        "name": "skywrath_crown_monologue_a_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_a_02.mp3",
        "text": "I see it in the faces of my fellow Queensguard."
    },
    {
        "name": "skywrath_crown_monologue_a_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_a_03.mp3",
        "text": "Just as they see all of that from me."
    },
    {
        "name": "skywrath_crown_monologue_a_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_a_04.mp3",
        "text": "We who failed, who ignored, who were complicit..."
    },
    {
        "name": "skywrath_crown_monologue_a_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_a_05.mp3",
        "text": "In the fall of my beloved Shen."
    },
    {
        "name": "skywrath_crown_monologue_a_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_a_06.mp3",
        "text": "But now I have something that changes everything."
    },
    {
        "name": "skywrath_crown_monologue_a_07",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_a_07.mp3",
        "text": "A source of power free from Imperia's leash."
    },
    {
        "name": "skywrath_crown_monologue_a_08",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_a_08.mp3",
        "text": "And those in the highest nests of the Eyrie are about to witness something they've never before seen from me."
    },
    {
        "name": "skywrath_crown_monologue_a_09",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_a_09.mp3",
        "text": "Rage."
    },
    {
        "name": "skywrath_crown_monologue_b_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_b_01.mp3",
        "text": "For so long, I served Imperia."
    },
    {
        "name": "skywrath_crown_monologue_b_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_b_02.mp3",
        "text": "But in my heart, Shen was my true queen."
    },
    {
        "name": "skywrath_crown_monologue_b_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_b_03.mp3",
        "text": "Once a year, I would summon her shade."
    },
    {
        "name": "skywrath_crown_monologue_b_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_b_04.mp3",
        "text": "And together we'd dream of what I feared may never come to be."
    },
    {
        "name": "skywrath_crown_monologue_b_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_b_05.mp3",
        "text": "But Scree'auk has seen fit to bless us."
    },
    {
        "name": "skywrath_crown_monologue_b_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_b_06.mp3",
        "text": "To make our dreams a reality."
    },
    {
        "name": "skywrath_crown_monologue_b_07",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_b_07.mp3",
        "text": "And a living nightmare for Imperia -- and all who serve the false queen."
    },
    {
        "name": "skywrath_crown_monologue_c_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_c_01.mp3",
        "text": "Treason to the crown..."
    },
    {
        "name": "skywrath_crown_monologue_c_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_c_02.mp3",
        "text": "It's punishable by death."
    },
    {
        "name": "skywrath_crown_monologue_c_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_c_03.mp3",
        "text": "Then what of those who take a crown by treason?"
    },
    {
        "name": "skywrath_crown_monologue_c_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_c_04.mp3",
        "text": "My oath is to that crown."
    },
    {
        "name": "skywrath_crown_monologue_c_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_c_05.mp3",
        "text": "Not to the usurper's head upon which it rests."
    },
    {
        "name": "skywrath_crown_monologue_c_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_c_06.mp3",
        "text": "Imperia, you've had that crown too long."
    },
    {
        "name": "skywrath_crown_monologue_c_07",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_c_07.mp3",
        "text": "Now it's time I have your head."
    },
    {
        "name": "skywrath_crown_monologue_d_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_d_01.mp3",
        "text": "Am I a Queensguard still?"
    },
    {
        "name": "skywrath_crown_monologue_d_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_d_02.mp3",
        "text": "Yes. The only true one."
    },
    {
        "name": "skywrath_crown_monologue_d_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_d_03.mp3",
        "text": "Only I guard the true queen."
    },
    {
        "name": "skywrath_crown_monologue_d_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_d_04.mp3",
        "text": "Till now I've guarded her memory."
    },
    {
        "name": "skywrath_crown_monologue_d_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_d_05.mp3",
        "text": "And the promise of what can be."
    },
    {
        "name": "skywrath_crown_monologue_d_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_monologue_d_06.mp3",
        "text": "Now, by Scree'auk, I guard her life again!"
    },
    {
        "name": "skywrath_crown_move_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_move_01.mp3",
        "text": "Try and keep pace."
    },
    {
        "name": "skywrath_crown_move_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_move_02.mp3",
        "text": "I fly."
    },
    {
        "name": "skywrath_crown_move_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_move_03.mp3",
        "text": "To wing."
    },
    {
        "name": "skywrath_crown_move_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_move_04.mp3",
        "text": "A good plan."
    },
    {
        "name": "skywrath_crown_move_05",
