    {
        "name": "skywrath_crown_respawn_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_03.mp3",
        "text": "I have unfinished business to attend to."
    },
    {
        "name": "skywrath_crown_respawn_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_04.mp3",
        "text": "By Scree'auk's mercy, I have returned."
    },
    {
        "name": "skywrath_crown_respawn_05",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_05.mp3",
        "text": "The Nest of Thorns gives me new life."
    },
    {
        "name": "skywrath_crown_respawn_06",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_06.mp3",
        "text": "My blood, once spilled, has returned to this vessel."
    },
    {
        "name": "skywrath_crown_respawn_07",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_07.mp3",
        "text": "My wounds were grave. But now, I return for blood."
    },
    {
        "name": "skywrath_crown_respawn_08",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_08.mp3",
        "text": "By the Ghastly Eyrie, I fly again."
    },
    {
        "name": "skywrath_crown_respawn_09",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_09.mp3",
        "text": "This time, I will do justice to her name."
    },
    {
        "name": "skywrath_crown_respawn_10",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_10.mp3",
        "text": "I shall not fail her this time."
    },
    {
        "name": "skywrath_crown_respawn_11",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_11.mp3",
        "text": "A queensguard's oath is not ended by death."
    },
    {
        "name": "skywrath_crown_respawn_12",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_12.mp3",
        "text": "I have hatched anew."
    },
    {
        "name": "skywrath_crown_respawn_13",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_13.mp3",
        "text": "Duty still beckons."
    },
    {
        "name": "skywrath_crown_respawn_14",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_14.mp3",
        "text": "My honor knows no bounds. Not even death."
    },
    {
        "name": "skywrath_crown_respawn_15",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_15.mp3",
        "text": "The workings of Scree'auk, or some other strange curse?"
    },
    {
        "name": "skywrath_crown_respawn_16",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_16.mp3",
        "text": "A fair point. But it seems I have more to say on it."
    },
    {
        "name": "skywrath_crown_respawn_17",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_17.mp3",
        "text": "I am undaunted."
    },
    {
        "name": "skywrath_crown_respawn_18",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_respawn_18.mp3",
        "text": "Power comes from the heart, and now mine beats anew."
    },
    {
        "name": "skywrath_crown_riki_ally_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_riki_ally_01.mp3",
        "text": "Here, help yourself to some of my lunch."
    },
    {
        "name": "skywrath_crown_riki_ally_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_riki_ally_02.mp3",
        "text": "I have some family recipes I wanted to share with you. Guard them with your life."
    },
    {
        "name": "skywrath_crown_riki_ally_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_riki_ally_03.mp3",
        "text": "Is that your new blade? Very nice."
    },
    {
        "name": "skywrath_crown_riki_ally_04",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_riki_ally_04.mp3",
        "text": "Let's put that new blade of yours to good use."
    },
    {
        "name": "skywrath_crown_riki_rival_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_riki_rival_01.mp3",
        "text": "You fought like a coward, and died worse than that."
    },
    {
        "name": "skywrath_crown_riki_rival_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_riki_rival_02.mp3",
        "text": "I knew when I first saw you that it might come to this."
    },
    {
        "name": "skywrath_crown_rival_001",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_001.mp3",
        "text": "Avernus has made a pawn of you."
    },
    {
        "name": "skywrath_crown_rival_005",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_005.mp3",
        "text": "Impatience brought you to this."
    },
    {
        "name": "skywrath_crown_rival_007",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_007.mp3",
        "text": "Madness consumes you. Let death set you free."
    },
    {
        "name": "skywrath_crown_rival_008",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_008.mp3",
        "text": "Your mind was filled with poison -- hypocracy and lies."
    },
    {
        "name": "skywrath_crown_rival_009",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_009.mp3",
        "text": "Lesser Ancients are the first to fall."
    },
    {
        "name": "skywrath_crown_rival_011",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_011.mp3",
        "text": "Your own people will celebrate your death."
    },
    {
        "name": "skywrath_crown_rival_013",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_013.mp3",
        "text": "My powers are beyond your grip."
    },
    {
        "name": "skywrath_crown_rival_015",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_015.mp3",
        "text": "Stolen wings fail you."
    },
    {
        "name": "skywrath_crown_rival_017",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_017.mp3",
        "text": "Carrion is carrion. I say let them feast."
    },
    {
        "name": "skywrath_crown_rival_019",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_019.mp3",
        "text": "Blinded by your own thirst."
    },
    {
        "name": "skywrath_crown_rival_021",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_021.mp3",
        "text": "You'll collect nothing but grief."
    },
    {
        "name": "skywrath_crown_rival_033",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_033.mp3",
        "text": "No one will mourn a knight of the fold. Not even the other knights."
    },
    {
        "name": "skywrath_crown_rival_045",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_045.mp3",
        "text": "We choose our own fates."
    },
    {
        "name": "skywrath_crown_rival_063",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_063.mp3",
        "text": "You lost your say long ago."
    },
    {
        "name": "skywrath_crown_rival_067",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_067.mp3",
        "text": "I'm not some easily charmed beast."
    },
    {
        "name": "skywrath_crown_rival_071",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_071.mp3",
        "text": "I've read stories about the powers of your kind. It seems they were misleading."
    },
    {
        "name": "skywrath_crown_rival_073",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_073.mp3",
        "text": "The spirits of your people howl for revenge."
    },
    {
        "name": "skywrath_crown_rival_075",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_075.mp3",
        "text": "You were always destined to crash."
    },
    {
        "name": "skywrath_crown_rival_077",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_077.mp3",
        "text": "Away with you, pest."
    },
    {
        "name": "skywrath_crown_rival_078",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_078.mp3",
        "text": "Skin the little rat for a scarf."
    },
    {
        "name": "skywrath_crown_rival_083",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_083.mp3",
        "text": "Intelligence welcomes hubris. Hubris invites risk."
    },
    {
        "name": "skywrath_crown_rival_095",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_095.mp3",
        "text": "You fight for nothing. A true cause always triumphs in the end."
    },
    {
        "name": "skywrath_crown_rival_097",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_097.mp3",
        "text": "What did your greed gain you? A glimpse of power and a pathetic end."
    },
    {
        "name": "skywrath_crown_rival_103",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_103.mp3",
        "text": "Power must be earned. There is no honor in theft."
    },
    {
        "name": "skywrath_crown_rival_108",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_108.mp3",
        "text": "The world is safer without your pet."
    },
    {
        "name": "skywrath_crown_rival_113",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_113.mp3",
        "text": "Know your place."
    },
    {
        "name": "skywrath_crown_rival_115",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_115.mp3",
        "text": "Gods are mere myth."
    },
    {
        "name": "skywrath_crown_rival_117",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_117.mp3",
        "text": "Your sisters are far beyond your reach."
    },
    {
        "name": "skywrath_crown_rival_119",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_119.mp3",
        "text": "Five ways a fool."
    },
    {
        "name": "skywrath_crown_rival_121",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_121.mp3",
        "text": "I took no pleasure in slaying that beast."
    },
    {
        "name": "skywrath_crown_rival_122",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_122.mp3",
        "text": "Do you speak for Helio? Consider this an act of war."
    },
    {
        "name": "skywrath_crown_rival_123",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_123.mp3",
        "text": "King of nothing but your own dreams."
    },
    {
        "name": "skywrath_crown_rival_125",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_125.mp3",
        "text": "Outsiders have no say in Skywrath affairs."
    },
    {
        "name": "skywrath_crown_rival_127",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_127.mp3",
        "text": "Scree'auk warned me about you, but your power was nothing fear."
    },
    {
        "name": "skywrath_crown_rival_129",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_129.mp3",
        "text": "You were a fool to take this fight on land."
    },
    {
        "name": "skywrath_crown_rival_131",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_131.mp3",
        "text": "You forgot your purpose. Punishment is swift."
    },
    {
        "name": "skywrath_crown_rival_133",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_133.mp3",
        "text": "You were loyal to no one -- and no one will mourn your death."
    },
    {
        "name": "skywrath_crown_rival_139",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_139.mp3",
        "text": "I don't believe in luck."
    },
    {
        "name": "skywrath_crown_rival_141",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_141.mp3",
        "text": "There is but one conclusion: the omniscience sent you to your death."
    },
    {
        "name": "skywrath_crown_rival_145",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_145.mp3",
        "text": "Ageless is not immortal."
    },
    {
        "name": "skywrath_crown_rival_147",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_147.mp3",
        "text": "A life without duty invites a meaningless end."
    },
    {
        "name": "skywrath_crown_rival_149",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_149.mp3",
        "text": "This is the fate of assassins and thieves."
    },
    {
        "name": "skywrath_crown_rival_155",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_155.mp3",
        "text": "There is no honor in this fight."
    },
    {
        "name": "skywrath_crown_rival_157",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_157.mp3",
        "text": "Elusive. But I quickly learned your tricks."
    },
    {
        "name": "skywrath_crown_rival_159",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_159.mp3",
        "text": "You're an abomination. Only fit to die."
    },
    {
        "name": "skywrath_crown_rival_163",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_163.mp3",
        "text": "Queen of nothing. I leave you beyond pain."
    },
    {
        "name": "skywrath_crown_rival_173",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_173.mp3",
        "text": "Your poison must be kept far from Skywrath."
    },
    {
        "name": "skywrath_crown_rival_179",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_179.mp3",
        "text": "None may silence me save my queen."
    },
    {
        "name": "skywrath_crown_rival_181",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_181.mp3",
        "text": "Fly away, Shen. We don't come back from this."
    },
    {
        "name": "skywrath_crown_rival_183",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_183.mp3",
        "text": "Next time send a flying fish."
    },
    {
        "name": "skywrath_crown_rival_185",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_185.mp3",
        "text": "Send a letter to the Conclave. Another petty criminal is dead."
    },
    {
        "name": "skywrath_crown_rival_187",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_187.mp3",
        "text": "You didn't lead me nearly enough."
    },
    {
        "name": "skywrath_crown_rival_189",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_189.mp3",
        "text": "You're not worth a second thought."
    },
    {
        "name": "skywrath_crown_rival_199",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_199.mp3",
        "text": "You cannot mine the skies, my friend."
    },
    {
        "name": "skywrath_crown_rival_201",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_201.mp3",
        "text": "You'll never see your temple again."
    },
    {
        "name": "skywrath_crown_rival_202",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_202.mp3",
        "text": "Let your master find you here."
    },
    {
        "name": "skywrath_crown_rival_203",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_203.mp3",
        "text": "Your deceptions were far too easy to read."
    },
    {
        "name": "skywrath_crown_rival_205",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_205.mp3",
        "text": "No one will carry you back to the sea, save the droppings of the gulls."
    },
    {
        "name": "skywrath_crown_rival_207",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_207.mp3",
        "text": "In Skywrath, the unstable are contained."
    },
    {
        "name": "skywrath_crown_rival_209",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_209.mp3",
        "text": "For the sake of the Eyrie, your contraptions must be destroyed."
    },
    {
        "name": "skywrath_crown_rival_213",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_213.mp3",
        "text": "What care have you for this fight?"
    },
    {
        "name": "skywrath_crown_rival_225",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_225.mp3",
        "text": "I will always protect Skywrath. Even from enemies within."
    },
    {
        "name": "skywrath_crown_rival_226",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_226.mp3",
        "text": "Whatever returned with Scree'auk...was not my Shen."
    },
    {
        "name": "skywrath_crown_rival_233",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_233.mp3",
        "text": "Enough with your meddling."
    },
    {
        "name": "skywrath_crown_rival_235",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_235.mp3",
        "text": "It's time to burn that book."
    },
    {
        "name": "skywrath_crown_rival_236",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_236.mp3",
        "text": "True intelligence is knowing the line. You never even saw the line."
    },
    {
        "name": "skywrath_crown_rival_237",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_237.mp3",
        "text": "You underestimate the powers of this realm."
    },
    {
        "name": "skywrath_crown_rival_239",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_239.mp3",
        "text": "I never lose course."
    },
    {
        "name": "skywrath_crown_rival_241",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_241.mp3",
        "text": "My gratitude only goes so far."
    },
    {
        "name": "skywrath_crown_rival_243",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_243.mp3",
        "text": "We have real doctors in Skywrath."
    },
    {
        "name": "skywrath_crown_rival_245",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_245.mp3",
        "text": "A true king serves. You serve nothing but yourself."
    },
    {
        "name": "skywrath_crown_rival_247",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_247.mp3",
        "text": "Yours is a pantheon of failure, Zeus."
    },
    {
        "name": "skywrath_crown_rival_301",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_301.mp3",
        "text": "And your people? Will they betray us next?"
    },
    {
        "name": "skywrath_crown_rival_302",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_302.mp3",
        "text": "You dare to threaten the people of Skywrath? Now you see how that ends."
    },
    {
        "name": "skywrath_crown_rival_305",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_rival_305.mp3",
        "text": "Get a real job."
    },
    {
        "name": "skywrath_crown_scepter_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_scepter_01.mp3",
        "text": "Aghanim is peculiar, but his power cannot be denied."
    },
    {
        "name": "skywrath_crown_scepter_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_scepter_02.mp3",
        "text": "The scepter is mine."
    },
    {
        "name": "skywrath_crown_scepter_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_scepter_03.mp3",
        "text": "This scepter shall aid in our quest."
    },
    {
        "name": "skywrath_crown_shard_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_shard_01.mp3",
        "text": "Even a shard of power could turn the tide."
    },
    {
        "name": "skywrath_crown_shard_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_shard_02.mp3",
        "text": "I'd much rather not pay for this."
    },
    {
        "name": "skywrath_crown_shield_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_shield_01.mp3",
        "text": "To help withstand their attacks."
    },
    {
        "name": "skywrath_crown_shield_02",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_shield_02.mp3",
        "text": "Shielded from harm."
    },
    {
        "name": "skywrath_crown_shield_03",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_shield_03.mp3",
        "text": "Safeguarded for now."
    },
    {
        "name": "skywrath_crown_shiwiz_01",
        "mp3": "/sounds/vo/skywrath_mage/skywrath_crown_shiwiz_01.mp3",
        "text": "I should curse that wizard..."
    },
    {
        "name": "skywrath_crown_slark_rival_01",
