void solve( int test ){

    int n ;
    cin >> n ;



    bitset < 10 > ans(0);
    int bit=0 , end = log2(n) + (log2(n) !=int(log2(n)));
    set < int > notask;
    while(bit < end){
        int cnt=0 , x , cnt2=0;
        for(int i =0 ; i <= n ; i++){
            bitset < 10 > bitss(i);
            if(bitss[bit])
                cnt2++;
            
        }
        vector < int > temp;
        for(auto& i : notask){
             bitset < 10 > bitss(i);
            if(bitss[bit])
                cnt++;
        }
        
        for(int i =1 ; i <= n; i++){
            if(notask.find(i) != notask.end()) continue;
            cout << "? " << i << " " << bit << endl;
            cin >> x;
            if(x){
               cnt++;
               
            }
            else 
                temp.pb(i);
        }
        
        if(cnt < cnt2){
            for(auto& t : temp) notask.insert(t);
            ans[bit]=1;
        }
       
        
       
        
        bit++;
    }
    
    int ret =0 , temp =1;
    for(int i =0 ; i < 10 ; i++) {
        if(ans[i])
            ret += temp;
        temp*=2;
    }

    cout << "! " << ret << endl;



}
 
 
